import React from 'react'

const ReadOnlyRow = ({ contact }) => {
    return (
        <tr>
            <td> {contact.date} </td>
            <td> {contact.food} </td>
            <td> {contact.calories}</td>
        </tr>
    )
}

export default ReadOnlyRow
